  render() {
    return (
      // <div>Persons</div>
      <div className="App">
        <label>Add Person</label>
        <input type="text" value="" onChange={this.addPerson}/>  <br />
        <label>Enter the Value of Jar</label>
        <input type="text" value={this.state.jar} onClick={this.jarHandler}/>  <br />
      </div>

    );
  }



}
